import React from 'react';
import '../../App.css';
export default function Products() {
  return (
    <>
      <h1 id="teamTitle">Meet The Team</h1>
      <div className="wrapperTeam">
        <img src='images/justinpic.JPG' alt='Justin Gerstl - GG Tennis Academy' id="justinTeamImg"></img>
        <div className="textTeam">
          <h2>Justin Gerstl</h2>
          <h3>Head Pro</h3>
          <p>Justin Gerstl is a former division one college player from Upper Saddle River, New Jersey. He has been teaching tennis for 13 years working with players from the high school varsity level through blue chip level.</p>
          <p>As a player Justin competed in USTA from when he was 10 through after college at futures and prize money tournaments. He has been through the process all advanced players in this area go through with competing, getting recruited, developing, and even seeing sports psychologists to better his mental approach to the game.</p>
          <p>Being around the sport for so long has helped Justin become the coach he is today and aids in him bringing a relevant and modern approach to his teachings.</p>
        </div>
      </div>
    </>

  );
}
